    <div class=""content"">
        <div id=""title"">
            TERMO DE CONVÊNIO PARA A REALIZAÇÃO DE ESTÁGIO
            (Agente de Integração)
        </div>
        <div class=""content-center"">
            Pelo presente instrumento particular, de um lado <span class=""font-bold"">Liderh Serviços e Projetos LTDA</span>. estabelecida na Rua Prudente de Moraes 36, Sala 01 - Santa Rosália Sorocaba/SP CEP 18095-030, inscrita no CNPJ sob nº. 37.581.067/0001-77, neste ato representado por seu sócio diretor Patrícia dos Santos Bedinelli na forma de seu Contrato Social, doravante denominada <span class=""font-bold"">AGENTE DE INTEGRAÇÃO</span>, e como  <span class=""font-bold"">INSTITUIÇÃO DE ENSINO</span>: CEETEPS - Centro Estadual de Educação Tecnológica Paula Souza - Mantenedora da ETEC Fernando Prestes, CNPJ sob nº. 62.823.257/0014-15 estabelecida na Rua Natal, 340 nº 340 - Bairro Jardim Paulistano, Sorocaba - SP, CEP 18040-810   , neste ato representado pela Sr. Divanil Antunes Urbano , Cargo de  Diretor, ce");
                WriteLiteral(@"lebram o presente <span class=""font-bold"">CONVÊNIO PARA A REALIZAÇÃO DE ESTÁGIO</span>, nos termos da Lei nº 11.788/2008, conforme as cláusulas abaixo discriminadas:

            <div class=""margin-top-30-px"">
                <div class=""margin-top-30-px"">
                    <h6 class=""font-bold"">1 – OBJETIVO DO ESTÁGIO</h6>
                    <div class=""margin-top-20-px"">
                        1.1 O objetivo do Estágio é o aprimoramento técnico, profissional, cultural e social do
                        Estudante estagiário, mediante a aprendizagem e participação prática junto aos departamentos competentes da <span class=""font-bold"">CONCEDENTE</span>, de forma supervisionada, visando a preparação para o trabalho produtivo.
                    </div>
                </div>
            </div>
            <div class=""margin-top-30-px"">
                <div class=""margin-top-30-px"">
                    <h6 class=""font-bold"">2 – PRAZO DO CONVÊNIO</h6>
                    <div class=""margin-top-");
                WriteLiteral(@"20-px"">
                        2.1. O prazo é indeterminado, podendo as partes, a qualquer tempo, mediante denúncia expressa e com antecedência de 60 (Sessenta) dias, provocar a rescisão do presente instrumento.
                    </div>
                </div>
            </div>
            <div class=""margin-top-30-px"">
                <div class=""margin-top-30-px"">
                    <h6 class=""font-bold"">3- DAS OBRIGAÇÕES DO AGENTE DE INTEGRAÇÃO</h6>
                    <div class=""margin-top-20-px"">
                        3.1 - Cabe ao <span class=""font-bold"">AGENTE DE INTEGRAÇÃO</span>:

                        <div class=""margin-top-30-px"">
                            3.1.1 - Identificar as oportunidades de estágio e desenvolver esforços para captar oportunidades de estágio, divulgando as condições e requisitos mínimos para a realização dos estágios;
                            <br />
                            3.1.2 - Ajustar as condições de realização;
                            <");
                WriteLiteral(@"br />
                            3.1.3 - Obter da <span class=""font-bold"">INSTITUIÇÃO DE ENSINO</span> informações sobre as condições e requisitos mínimos para a realização dos estágios de seus estudantes;
                            <br />
                            3.1.4 - Obter das <span class=""font-bold"">CONCEDENTES</span> a quantificação das oportunidades de estágio a serem concedidas, com identificação dos respectivos cursos com os quais as mesmas disponham de condições para oferecer estágio;
                            <br />
                            3.1.5 - Promover os ajustes das condições de estágio, conciliando os requisitos mínimos exigidos pela <span class=""font-bold"">
                                INSTITUIÇAO DE ENSINO
                            </span> com as condições/disponibilidades das <span class=""font-bold"">CONCEDENTES</span>;
                            <br />
                            3.1.6 - Fornecer aos estudantes convocados todos os dados e informações que caracter");
                WriteLiteral(@"izam cada oportunidade de estágio;
                            <br />
                            3.1.7 - Encaminhar às <span class=""font-bold"">
                                CONCEDENTES
                            </span> os estudantes que se identificarem com as respectivas oportunidades de estágio;
                            <br />
                            3.1.8 - Preparar e providenciar que o (a) <span class=""font-bold"">ESTAGIÁRIO (A)</span>, a <span class=""font-bold"">CONCEDENTE</span> e a <span class=""font-bold"">INSTITUIÇÃO DE ENSINO</span> assinem o Termo de Compromisso de Estágio;
                            <br />
                            3.1.9 - Fazer o acompanhamento administrativo;
                            <br />
                            3.1.10 - Encaminhar a negociação de seguro contra acidentes pessoais;
                            <br />
                            3.1.11 - Cadastrar estudantes;
                            <br />
                            3.1.12 - ");
                WriteLiteral(@"Disponibilizar ao <span class=""font-bold"">ESTAGIÁRIO</span> formulário de Relatório de Acompanhamento do Estágio, periodicamente e disponibilizar para as <span class=""font-bold"">
                                INSTITUIÇÕES DE ENSINO
                            </span> as informações do Relatório preenchido pelo aluno, comprovado por vistos do Supervisor da <span class=""font-bold"">CONCEDENTE</span> para acompanhamento, avaliação, supervisão e controle do Estágio.
                            <br />
                            3.2 - Cabe também ao <span class=""font-bold"">AGENTE DE INTEGRAÇÃO</span> notificar a <span class=""font-bold"">CONCEDENTE</span> sobre as suas responsabilidades legais, técnicas e administrativas, inclusive quanto ao Seguro de Acidentes Pessoais do estudante em estágio, nos termos da Lei 11.788/2008, caso identifique violação dos compromissos aqui assumidos, por quaisquer das partes.
                            <br />
                            3.3 - Os <span class=""font-bold"">AGENTE");
                WriteLiteral(@"S DE INTEGRAÇÃO</span> serão responsabilizados civilmente se indicarem estagiários para a realização de atividades não compatíveis com a programação curricular estabelecida para cada curso, assim como estagiários matriculados em cursos ou instituições para as quais não há previsão de estágio curricular.
                        </div>
                    </div>
                </div>
            </div>
            <div class=""margin-top-30-px"">
                <div class=""margin-top-30-px"">
                    <h6 class=""font-bold"">4 – OBRIGAÇÕES DA INSTITUIÇÃO DE ENSINO</h6>
                    <div class=""margin-top-20-px"">
                        4.1 - Cabe à <span class=""font-bold"">INSTITUIÇÃO DE ENSINO</span>:

                        <div class=""margin-top-30-px"">
                            4.1.1. - Fornecer ao <span class=""font-bold"">AGENTE DE INTEGRAÇÃO</span> informações que consubstanciem as condições /requisitos mínimos para a realização dos estágios de estudantes de seu Corpo Discente;");
                WriteLiteral(@"
                            <br />
                            4.1.2 -  Divulgar junto a seus estudantes, quando for o caso, as oportunidades de estágio captadas pelo agente de integração;
                            <br />
                            4.1.3 - Assinar os Termos de Compromisso de Estágio que vierem a ser celebrados entre seus estudantes e as <span class=""font-bold"">CONCEDENTES</span> conveniadas com o agente de integração, desde que atendidos os requisitos impostos pela Lei n.º 11.788/2008;
                            <br />
                            4.1.4 - Se houver solicitação expressa, a <span class=""font-bold"">INSTITUIÇÃO DE ENSINO</span> providenciará a divulgação no “Campus” de material fornecido pela CONCEDENTE, anunciando vagas para indicação de alunos interessados no Estágio.
                        </div>
                    </div>
                </div>
            </div>
            <div class=""margin-top-30-px"">
                <div class=""margin-top-30-px"">
      ");
                WriteLiteral(@"              <h6 class=""font-bold"">5 – DISPOSIÇÕES FINAIS</h6>
                    <div class=""margin-top-20-px"">
                        5.1 - As atividades do <span class=""font-bold"">AGENTE DE INTEGRAÇÃO</span> explicitadas na cláusula 3 não implicarão em qualquer ônus para a <span class=""font-bold"">INSTITUIÇÃO DE ENSINO</span>, nem para seus estudantes que vierem a se beneficiar de tais ações.

                        <div class=""margin-top-30-px"">
                            Fica eleito o Foro da Comarca de Sorocaba  no Estado de São Paulo, com renúncia de qualquer outro, por mais privilegiado que seja, para dirimir quaisquer dúvidas ou controvérsias que se originarem deste Convênio.
                            <br />
                            <br />
                            Estando de acordo com as condições acima estipuladas, firmam o presente instrumento de <span class=""font-bold"">TERMO DE CONVÊNIO PARA A REALIZAÇÃO DE ESTÁGIO</span> em 2(duas) vias e/ou por Assinatura Eletrônica de igual");
                WriteLiteral(@" teor e forma, na presença das testemunhas abaixo arroladas.
                        </div>
                    </div>
                </div>
            </div>
            <div class=""margin-top-30-px"">
                Sorocaba, 16 de Julho de 2020.
            </div>
            <div class=""margin-top-30-px"">
                <span class=""font-bold"">Liderh Serviços e Projetos LTDA</span>
                <br />
                Agente de Integração
            </div>
            <div class=""margin-top-30-px"">
                TESTEMUNHAS:
            </div>
            <div class=""margin-top-30-px"">
                Bruno
                <br />
                RG:
            </div>
            <div class=""margin-top-30-px"">
                Amanda Peres
                <br />
                RG: 44908340-8
            </div>
        </div>
    </div>
    <section class=""botoes center"">
        <a class=""btn btn-primary grey"" href=""#"" onclick=""window.history.back()"">Voltar</a>
      ");
                WriteLiteral("  <a class=\"btn btn-primary\" onclick=\"javascript:window.print();\">Imprimir</a>\r\n    </section>\r\n");
            }
